CKey GetDogeSecretKey(JSONRPCRequest r, std::string sBBPPubKey)
{
    std::shared_ptr<CWallet> const wallet = GetWalletForJSONRPCRequest(r);
    if (!wallet) {
        throw JSONRPCError(RPC_TYPE_ERROR, "Is wallet unlocked?");
    }
    const CWallet* const pwallet = wallet.get();
    LegacyScriptPubKeyMan& spk_man = EnsureLegacyScriptPubKeyMan(*wallet);
    LOCK2(pwallet->cs_wallet, spk_man.cs_KeyStore);
    EnsureWalletIsUnlocked(pwallet);
    CTxDestination dest = DecodeDestination(sBBPPubKey);
    if (!IsValidDestination(dest)) {
        throw JSONRPCError(RPC_TYPE_ERROR, "Invalid destination");
    }
    const PKHash* pkhash = std::get_if<PKHash>(&dest);
    if (!pkhash) {
        throw JSONRPCError(RPC_TYPE_ERROR, "Address does not refer to a key");
    }
    CKey vchSecret;
    if (!spk_man.GetKey(ToKeyID(*pkhash), vchSecret)) {
        throw JSONRPCError(RPC_WALLET_ERROR, "Private key for address " + sBBPPubKey + " is not known");
    }
    CKey vchSecretDoge;
    if (spk_man.GetKey(ToKeyID(*pkhash), vchSecretDoge)) {
        return vchSecretDoge;
    } else {
        throw JSONRPCError(RPC_WALLET_ERROR, "Unable to retrieve key");
    }
}

