std::string EncryptBlockCypherString(const std::string& sData, const std::string& sPassword)
{
    int iPos = 0;
    std::string sHex;
    for (size_t i = 0; i < sData.length(); i++) {
         char cChar = sData[i];
         char cPasswChar = sPassword[iPos];

         int sum = static_cast<int>(cChar) + static_cast<int>(cPasswChar);
         if (sum > 255)
             sum -= 255;

         std::stringstream ss;
         ss << std::uppercase << std::setw(2) << std::setfill('0') << std::hex << sum;
         sHex += ss.str();

         iPos++;
         if (iPos >= sPassword.length()) {
             iPos = 0;
         }
    }
    return sHex;
}

