std::string DecryptBlockCypherString(const std::string& sData, const std::string& sPassword)
{
    int iPos = 0;
    std::string sOut;
    for (size_t i = 0; i < sData.length(); i += 2) {
         std::string sChunk = sData.substr(i, 2);
         int nValue;
         std::stringstream ss;
         ss << std::hex << sChunk;
         ss >> nValue;
         char cPassChar = sPassword[iPos];
         int dif = nValue - static_cast<int>(cPassChar);
         if (dif < 0) {
             dif += 255;
         }
         char cDecChar = static_cast<char>(dif);
         sOut += cDecChar;
         iPos++;
         if (iPos >= sPassword.length()) {
             iPos = 0;
         }
    }
    return sOut;
}


